import { mapGetters } from 'vuex'
import { getWeatherInfo } from '@/api/weather-model'

export default {
  components: {},
  data() {
    return {
      weatherList: [],
      title: ''
    }
  },
  computed: {
    ...mapGetters([
      'token'
    ])
  },
  created() {
    this.getWeatherInfo()
  },
  methods: {
    handleBack() {
      this.$router.go(-1)
    },
    getWeatherInfo() {
      getWeatherInfo(getWeatherInfo).then(response => {
        this.title = response['records']['datasetDescription']
        this.weatherList = response['records']['location']
      })
    },
    elementFilter(elementName) {
      switch (elementName) {
        case 'Wx':
          return '天氣現象'
        case 'PoP':
          return '降雨機率(%)'
        case 'CI':
          return '舒適度'
        case 'MinT':
          return '最低溫度(攝氏度)'
        case 'MaxT':
          return '最高溫度(攝氏度)'
        default:
          return 'Default'
      }
    }
  }
}
